import './App.css';
import Todo from './components/Todo';

function App() {

  let todos = [
    {
      id: 1, 
      name: "todo1",
      completed: true
    },
    {
      id: 2, 
      name: "todo2",
      completed: false
    }
  ];

  return (
    <div className="App">
      <Todo  />
      <Todo />
      <Todo />
      <Todo />
    </div>
  );
}

export default App;
